    // 将对象数组转换为二维数组
    function objectToArray(data) {
        return data.map(element => Object.values(element));
    }

    // 在二维数组的每一个子数组的最后一个元素后面加上900，用于设置bar的长度，这样就不会影响原始数据
    function addBarLength(data) {
        return data.map(element => {
            element.push(900);
            return element;
        });
    }

    // 将SNP数据转换为散点图数据
    function SNPDataToScatter(data) {
        let SNPData = [];
        data.map(function (item) {
            // data.haplotypeSNP.split('; ').map(entry => entry.split(':'));
            let IDBasePair = item[6].split('; ').map(entry => entry.split(':'));
            IDBasePair.forEach(function (element) {
                SNPData.push([item[0], item[2], element[0], element[1]]);
            });
        });
        return SNPData;
    }

