// 传入一个二维数组和一个容器，更新表格
function updateSNPTable(data, container) {
    container.innerHTML = '';  // 清空当前表格
    data.forEach(row => {
        const tr = document.createElement('tr');
        // 如果row的数组长度为6，那么就是SNP表格的数据
        if (row.length === 6) {
            tr.innerHTML = `<td>${row[0]}</td>
                            <td>${row[1]}</td>
                            <td>${row[2]}</td>
                            <td>${row[3]}</td>
                            <td>${row[4]}</td>
                            <td>${row[5]}</td>`;
        }
        else {
            tr.innerHTML = `<td>${row[0]}</td>
                            <td>${row[1]}</td>
                            <td>${row[2]}</td>
                            <td>${row[3]}</td>
                            <td>${row[4]}</td>`;
        }
        container.appendChild(tr);
    });
}

